bio:
Более 20 лет практического опыта в области геоинформационных технологий и дистанционного зондирования Земли, в том числе около 10 лет в нефтегазовой отрасли.
Кандидат геолого-минералогических наук, автор более 30 научных публикаций и трех патентов.

Ключевые компетенции
УПРАВЛЕНИЕ И КОММУНИКАТИВНЫЕ НАВЫКИ:
- опыт работы на руководящих должностях более 5 лет (формирование организационной структуры, управление персоналом, удаленными проектными командами);
- большой опыт переговоров и взаимодействия с клиентами и подрядчиками, в т.ч. с первыми лицами;
- навыки координации взаимодействия между заказчиками, менеджерами проектов, маркетологами, разработчиками, дизайнерами в процессе создания и внедрения продуктов и технологических решений.

СОЗДАНИЕ И ПРОДВИЖЕНИЕ ПРОДУКТОВ:
- опыт проведения маркетинговых исследований, изучения потребностей клиентов, формирования требований к продукту;
- практический опыт создания инновационных продуктов и технологий (проведение исследований и разработок, патентование);
- постановка задач для разработки геоинформационных систем, специализированного ПО, мобильных приложений, приборов;
- большой опыт разработки ТЗ, технической и проектной документации (в том числе в соответствии с ГОСТ серии 19, 34), подготовки презентационных и аналитических материалов по продуктам для обеспечения продаж;
- опыт коммерциализации инновационных разработок (сертификация, выведение на рынок, предоставление сервисных услуг), участие в продажах.

ГИС и ДЗЗ:
- разработка национальных стандартов, устанавливающих систему требований к данным ДЗЗ из космоса;
- разработка комплексов нормативных документов в области предоставления продуктов ДЗЗ потребителям;
- организация и выполнение научных и прикладных исследований в области ГИС и ДЗЗ;
- организация и выполнение проектов по геологоразведке, геоэкологии, мониторингу окружающей среды и инженерных объектов на основе аэрокосмической съемки для PETRONAS (Малайзия), Tihgsa (Испания), ЛУКОЙЛ, Татнефть, Транснефть (Россия) и др.;
- практический опыт разработки и применения инновационных аэрокосмических экспресс-методов для региональных исследований УВ бассейнов и поиска нефтегазовых залежей, оценки экологического состояния объектов добычи, транспортировки и переработки УВ;
- ГИС-специализация: разработка сервисов геоданных, подготовка датасетов для машинного обучения, геомоделирование, пространственный анализ.

I am a dedicated recruiter who is very passionate about the IT field. My expertise can help you achieve such tasks as:
•	Finding that Star candidate who is not just a “Nice-to-have”, but is a “Must-have” with the core competencies needed to be successful; Finding the "unfindable" candidates;
•	Fighting the good fight to replace Manual recruiting with Automated goodness;
•	Increasing team pride and confidence while trying to influence the business process - an awesome opportunity to raise champions in the organization;
•	You give me the tools and support and I will bring You the passion and drive; 
•	Software developers are the lifeblood of each company and I see it as my responsibility to find them and grow them.

Looking for a person who thrives on a challenge? You have found one! ;-)
